rvice, identifying and communicating with you, responding to your requests/inquiries, servicing your purchase orders, and improving our services.\r\n\r\n<strong>Log Data</strong>\r\nWe may also collect information that your browser sends whenever you visit our Service (\"Log Data\"). This Log Data may include information such as your computer\'s Internet Protocol (\"IP\") address, browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages and other statistics.\r\n\r\nIn addition, we may use third party services such as Google Analytics that collect, monitor and analyze this type of information in order to increase our Service\'s functionality. These third party service providers have their own privacy policies addressing how they use such information.\r\n\r\n<strong>Cookies</strong>\r\nCookies are files with a small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and transferred to your device. We use cookies to collect information in order to improve our services for you.\r\n\r\nYou can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. The Help feature on most browsers provide information on how to accept cookies, disable cookies or to notify you when receiving a new cookie.\r\n\r\nIf you do not accept cookies, you may not be able to use some features of our Service and we recommend that you leave them turned on.\r\n\r\n<strong>Behavioral Remarketing\r\n</strong>Muudu furniture uses remarketing services to advertise on third party web sites to you after you visited our Service. We, and our third party vendors, use cookies to inform, optimize and serve ads based on your past visits to our Service.\r\n\r\n<strong>Google\r\n</strong>Google AdWords remarketing service is provided by Google Inc.\r\n\r\nYou can opt-out of Google Analytics for Display Advertising and customize the Google Display Network ads by visiting the Google Ads Settings page: http://www.google.com/settings/ads\r\n\r\nGoogle also recommends installing the Google Analytics Opt-out Browser Add-on - https://tools.google.com/dlpage/gaoptout - for your web browser. Google Analytics Opt-out Browser Add-on provides visitors with the ability to prevent their data from being collected and used by Google Analytics.\r\n\r\nFor more information on the privacy practices of Google, please visit the Google Privacy &amp; Terms web page: http://www.google.com/intl/en/policies/privacy/\r\nFacebook\r\n\r\n<strong>Facebook remarketing service is provided by Facebook Inc.\r\n</strong>You can learn more about interest-based advertising from Facebook by visiting this page: https://www.facebook.com/help/164968693837950\r\n\r\nTo opt-out from Facebook\'s interest-based ads follow these instructions from Facebook: https://www.facebook.com/about/ads/#568137493302217\r\n\r\nFacebook adheres the Self-Regulatory Principles for Online Behavioral Advertising established by the Digital Advertising Alliance. You can also opt-out from Facebook and other participating companies through the Digital Advertising Alliance in the USA http://www.aboutads.info/choices/, the Digital Advertising Alliance of Canada in Canada http://youradchoices.ca/ or the European Interactive Digital Advertising Alliance in Europe http://www.youronlinechoices.eu/, or opt-out using your mobile device settings.\r\n\r\nFor more information on the privacy practices of Facebook, please visit Facebook\'s Data Policy: https://www.facebook.com/privacy/explanation\r\nPinterest\r\n\r\n<strong>Pinterest remarketing service is provided by Pinterest Inc.\r\n</strong>You can opt-out from Pinterest\'s interest-based ads by enabling the \"Do Not Track\" functionality of your web browser or by following Pinterest instructions: http://help.pinterest.com/en/articles/personalization-and-data\r\n\r\nYou can learn more about the privacy practices and policies of Pinterest by visiting their Privacy Policy page: https://about.pinterest.com/en/privacy-policy\r\nAdRoll\r\n\r\n<strong>AdRoll remarketing service is provided by Semantic Sugar, Inc.\r\n</strong>You can opt-out of AdRoll remarketing by visiting this AdRoll Advertising Preferences web page: http://info.evidon.com/pub_info/573?v=1&amp;nt=1&amp;nw=false\r\n\r\nFor more information on the privacy practices of AdRoll, please visit the AdRoll Privacy Policy web page: http://www.adroll.com/about/privacy\r\nDo Not Track Disclosure\r\n\r\nWe support Do Not Track (\"DNT\"). Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.\r\n\r\nYou can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.\r\n\r\n<strong>Service Providers</strong>\r\nWe may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services and/or to assist us in analyzing how our Service is used.\r\n\r\nThese third parties have access to your Personal Information only to perform specific tasks on our behalf and are obligated not to disclose or use your information for any other purpose.\r\n\r\n<strong>Communications</strong>\r\nWe may use your Personal Information to contact you with newsletters, marketing or promotional materials and other information that may be of interest to you. You may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or instructions provided in any email we send.\r\n\r\n<strong>Compliance With Laws</strong>\r\nWe will disclose your Personal Information where required to do so by law or subpoena or if we believe that such action is necessary to comply with the law and the reasonable requests of law enforcement or to protect the security or integrity of our Service.\r\n\r\n<strong>Security</strong>\r\nThe security of your Personal Information is important to us, and we strive to implement and maintain reasonable, commercially acceptable security procedures and practices appropriate to the nature of the information we store, in order to protect it from unauthorized access, destruction, use, modification, or disclosure.\r\n\r\nHowever, please be aware that no method of transmission over the internet, or method of electronic storage is 100% secure and we are unable to guarantee the absolute security of the Personal Information we have collected from you.\r\n\r\n<strong>International Transfer</strong>\r\nYour information, including Personal Information, may be transferred to  and maintained on  computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from your jurisdiction.\r\n\r\nIf you are located outside United States and choose to provide information to us, please note that we transfer the information, including Personal Information, to United States and process it there.\r\n\r\nYour consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.\r\n\r\n<strong>Links To Other Sites</strong>\r\nOur Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party\'s site. We strongly advise you to review the Privacy Policy of every site you visit.\r\n\r\nWe have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.\r\n\r\n<strong>Children\'s Privacy</strong>\r\nOnly persons age 18 or older have permission to access our Service. Our Service does not address anyone under the age of 13 (\"Children\").\r\n\r\nWe do not knowingly collect personally identifiable information from children under 13. If you are a parent or guardian and you learn that your Children have provided us with Personal Information, please contact us. If we become aware that we have collected Personal Information from a children under age 13 without verification of parental consent, we take steps to remove that information from our servers.\r\n\r\n<strong>Changes To This Privacy Policy</strong>\r\nThis Privacy Policy is effective as of April 01, 2017 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.\r\n\r\nWe reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.\r\n\r\nIf we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.\r\n\r\n<strong>Contact Us</strong>\r\nIf you have any questions about this Privacy Policy, please contact us.','Privacy Policy','','publish','closed','closed','','privacy-policy','','','2017-09-06 07:51:40','2017-09-06 07:51:40','',0,'http://192.168.1.122/melrose/?page_id=1152',0,'page','',0),(1153,1,'2017-09-06 07:51:03','2017-09-06 07:51:03','Muuduu Furniture LLC (\"us\", \"we\", or \"our\") operates the https://www.muuduufurniture.com website (the \"Service\").\r\n\r\nThis page informs you of our policies regarding the collection, use and disclosure of Personal Information when you use our Service.\r\n\r\nWe will not use or share your information with anyone except as described in this Privacy Policy.\r\n\r\nWe use your Personal Information for providing and improving the Service. By using the Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, accessible at http://www.karu.world\r\n\r\n<strong>Information Collection And Use\r\n</strong>While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to, your email address, name, phone number, postal address (\"Personal Information\"). We collect this information for the purpose of providing the Service, identifying and communicating with you, responding to your requests/inquiries, servicing your purchase orders, and improving our services.\r\n\r\n<strong>Log Data</strong>\r\nWe may also collect information that your browser sends whenever you visit our Service (\"Log Data\"). This Log Data may include information such as your computer\'s Internet Protocol (\"IP\") address, browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages and other statistics.\r\n\r\nIn addition, we may use third party services such as Google Analytics that collect, monitor and analyze this type of information in order to increase our Service\'s functionality. These third party service providers have their own privacy policies addressing how they use such information.\r\n\r\n<strong>Cookies</strong>\r\nCookies are files with a small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and transferred to your device. We use cookies to collect information in order to improve our services for you.\r\n\r\nYou can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. The Help feature on most browsers provide information on how to accept cookies, disable cookies or to notify you when receiving a new cookie.\r\n\r\nIf you do not accept cookies, you may not be able to use some features of our Service and we recommend that you leave them turned on.\r\n\r\n<strong>Behavioral Remarketing\r\n</strong>Muudu furniture uses remarketing services to advertise on third party web sites to you after you visited our Service. We, and our third party vendors, use cookies to inform, optimize and serve ads based on your past visits to our Service.\r\n\r\n<strong>Google\r\n</strong>Google AdWords remarketing service is provided by Google Inc.\r\n\r\nYou can opt-out of Google Analytics for Display Advertising and customize the Google Display Network ads by visiting the Google Ads Settings page: http://www.google.com/settings/ads\r\n\r\nGoogle also recommends installing the Google Analytics Opt-out Browser Add-on - https://tools.google.com/dlpage/gaoptout - for your web browser. Google Analytics Opt-out Browser Add-on provides visitors with the ability to prevent their data from being collected and used by Google Analytics.\r\n\r\nFor more information on the privacy practices of Google, please visit the Google Privacy &amp; Terms web page: http://www.google.com/intl/en/policies/privacy/\r\nFacebook\r\n\r\n<strong>Facebook remarketing service is provided by Facebook Inc.\r\n</strong>You can learn more about interest-based advertising from Facebook by visiting this page: https://www.facebook.com/help/164968693837950\r\n\r\nTo opt-out from Facebook\'s interest-based ads follow these instructions from Facebook: https://www.facebook.com/about/ads/#568137493302217\r\n\r\nFacebook adheres the Self-Regulatory Principles for Online Behavioral Advertising established by the Digital Advertising Alliance. You can also opt-out from Facebook and other participating companies through the Digital Advertising Alliance in the USA http://www.aboutads.info/choices/, the Digital Advertising Alliance of Canada in Canada http://youradchoices.ca/ or the European Interactive Digital Advertising Alliance in Europe http://www.youronlinechoices.eu/, or opt-out using your mobile device settings.\r\n\r\nFor more information on the privacy practices of Facebook, please visit Facebook\'s Data Policy: https://www.facebook.com/privacy/explanation\r\nPinterest\r\n\r\n<strong>Pinterest remarketing service is provided by Pinterest Inc.\r\n</strong>You can opt-out from Pinterest\'s interest-based ads by enabling the \"Do Not Track\" functionality of your web browser or by following Pinterest instructions: http://help.pinterest.com/en/articles/personalization-and-data\r\n\r\nYou can learn more about the privacy practices and policies of Pinterest by visiting their Privacy Policy page: https://about.pinterest.com/en/privacy-policy\r\nAdRoll\r\n\r\n<strong>AdRoll remarketing service is provided by Semantic Sugar, Inc.\r\n</strong>You can opt-out of AdRoll remarketing by visiting this AdRoll Advertising Preferences web page: http://info.evidon.com/pub_info/573?v=1&amp;nt=1&amp;nw=false\r\n\r\nFor more information on the privacy practices of AdRoll, please visit the AdRoll Privacy Policy web page: http://www.adroll.com/about/privacy\r\nDo Not Track Disclosure\r\n\r\nWe support Do Not Track (\"DNT\"). Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.\r\n\r\nYou can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.\r\n\r\n<strong>Service Providers</strong>\r\nWe may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services and/or to assist us in analyzing how our Service is used.\r\n\r\nThese third parties have access to your Personal Information only to perform specific tasks on our behalf and are obligated not to disclose or use your information for any other purpose.\r\n\r\n<strong>Communications</strong>\r\nWe may use your Personal Information to contact you with newsletters, marketing or promotional materials and other information that may be of interest to you. You may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or instructions provided in any email we send.\r\n\r\n<strong>Compliance With Laws</strong>\r\nWe will disclose your Personal Information where required to do so by law or subpoena or if we believe that such action is necessary to comply with the law and the reasonable requests of law enforcement or to protect the security or integrity of our Service.\r\n\r\n<strong>Security</strong>\r\nThe security of your Personal Information is important to us, and we strive to implement and maintain reasonable, commercially acceptable security procedures and practices appropriate to the nature of the information we store, in order to protect it from unauthorized access, destruction, use, modification, or disclosure.\r\n\r\nHowever, please be aware that no method of transmission over the internet, or method of electronic storage is 100% secure and we are unable to guarantee the absolute security of the Personal Information we have collected from you.\r\n\r\n<strong>International Transfer</strong>\r\nYour information, including Personal Information, may be transferred to  and maintained on  computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from your jurisdiction.\r\n\r\nIf you are located outside United States and choose to provide information to us, please note that we transfer the information, including Personal Information, to United States and process it there.\r\n\r\nYour consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.\r\n\r\n<strong>Links To Other Sites</strong>\r\nOur Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party\'s site. We strongly advise you to review the Privacy Policy of every site you visit.\r\n\r\nWe have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.\r\n\r\n<strong>Children\'s Privacy</strong>\r\nOnly persons age 18 or older have permission to access our Service. Our Service does not address anyone under the age of 13 (\"Children\").\r\n\r\nWe do not knowingly collect personally identifiable information from children under 13. If you are a parent or guardian and you learn that your Children have provided us with Personal Information, please contact us. If we become aware that we have collected Personal Information from a children under age 13 without verification of parental consent, we take steps to remove that information from our servers.\r\n\r\n<strong>Changes To This Privacy Policy</strong>\r\nThis Privacy Policy is effective as of April 01, 2017 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.\r\n\r\nWe reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.\r\n\r\nIf we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.\r\n\r\n<strong>Contact Us</strong>\r\nIf you have any questions about this Privacy Policy, please contact us.','Privacy Policy','','inherit','closed','closed','','1152-revision-v1','','','2017-09-06 07:51:03','2017-09-06 07:51:03','',1152,'http://192.168.1.122/melrose/2017/09/06/1152-revision-v1/',0,'revision','',0),(1155,2,'2017-09-06 08:06:49','0000-00-00 00:00:00','<div>\r\n<ul>\r\n 	<li style=\"text-align: center;\">After you place your order, a representative will contact you within 1 to 7 business days to book your delivery date or a pickup date at the warehouse. We will contact you again on the date of your delivery to confirm your address and time frame. Currently, we only have two time frames: 10AM-3PM, and 3PM to 7PM. Your driver will call you one to two hours ahead before arrival. Due to the heavy traffic in Southern and Northern California, sometimes the delivery team may arrive outside of your window. Thank you for your understanding and patience.</li>\r\n 	<li style=\"text-align: center;\">For Southern California\'s Customer, all in stock products will be delivered within 3-14 business days since the date of purchase. For Northern California orders, all in stock products will be delivered within7 to 21 business day since the date of purchase.</li>\r\n 	<li style=\"text-align: center;\">For other U.S. States, your pallet(s) will be delivered by a freight company within 7 business days or sooner after pickup from our warehouse. Upon pickup from our warehouse, the freight company will provide us a tracking number for your pallet(s), and we will forward the info. to you so you can track it(them) along the way.</li>\r\n 	<li style=\"text-align: center;\">All special orders or custom-made orders may take up from 4 to 12 weeks. Please call for more details.</li>\r\n 	<li style=\"text-align: center;\"><strong>If you need us to expedite an order, please email or call in for more information.</strong></li>\r\n</ul>\r\n<ul>\r\n 	<li style=\"text-align: center;\">Customers who pay with a debit, a credit, or Paypal must present his or her ID upon receipt. If someone else is going to receive the order for you, he or she must present a government identification.</li>\r\n 	<li style=\"text-align: center;\">If you must reschedule your delivery date for free of charge, please feel free to reach out to our Customer Service team at (909)321-6683 or email us at customerservice@muuduufurniture.com at least 24 hours before your scheduled delivery.</li>\r\n 	<li style=\"text-align: center;\">If you want us to leave your merchandise outside of your location, please email in your order ID number, your driver license, and your instruction.</li>\r\n 	<li style=\"text-align: center;\">If your delivery time frame was confirmed and you can\'t receive your merchandise due to unplanned factors, we will assist you to reschedule your shipping and the original delivery fee will apply again.</li>\r\n</ul>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Delivery Information</h2>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\">$27.99 Flat shipping rate for most California cities between Sacramento to San Diego, exclude Victorville, Palmdale, Apple Valley, Hesperia, Lancaster, Indio and Big Bear Lake.</p>\r\n\r\n<h2 style=\"text-align: center;\">Other U.S. STATES, please email in the item number(s) you are interested, your city, your state, your contact information, and we will email you back with the shipping quote. Thank you for your business and support.</h2>\r\n</div>','Delivery','','draft','closed','closed','','','','','2017-09-06 08:06:49','2017-09-06 08:06:49','',0,'http://192.168.1.122/melrose/?page_id=1155',0,'page','',0),(1156,2,'2017-09-06 08:06:32','2017-09-06 08:06:32','<div>\r\n<ul>\r\n 	<li style=\"text-align: center;\">After you place your order, a representative will contact you within 1 to 7 business days to book your delivery date or a pickup date at the warehouse. We will contact you again on the date of your delivery to confirm your address and time frame. Currently, we only have two time frames: 10AM-3PM, and 3PM to 7PM. Your driver will call you one to two hours ahead before arrival. Due to the heavy traffic in Southern and Northern California, sometimes the delivery team may arrive outside of your window. Thank you for your understanding and patience.</li>\r\n 	<li style=\"text-align: center;\">For Southern California\'s Customer, all in stock products will be delivered within 3-14 business days since the date of purchase. For Northern California orders, all in stock products will be delivered within7 to 21 business day since the date of purchase.</li>\r\n 	<li style=\"text-align: center;\">For other U.S. States, your pallet(s) will be delivered by a freight company within 7 business days or sooner after pickup from our warehouse. Upon pickup from our warehouse, the freight company will provide us a tracking number for your pallet(s), and we will forward the info. to you so you can track it(them) along the way.</li>\r\n 	<li style=\"text-align: center;\">All special orders or custom-made orders may take up from 4 to 12 weeks. Please call for more details.</li>\r\n 	<li style=\"text-align: center;\"><strong>If you need us to expedite an order, please email or call in for more information.</strong></li>\r\n</ul>\r\n<ul>\r\n 	<li style=\"text-align: center;\">Customers who pay with a debit, a credit, or Paypal must present his or her ID upon receipt. If someone else is going to receive the order for you, he or she must present a government identification.</li>\r\n 	<li style=\"text-align: center;\">If you must reschedule your delivery date for free of charge, please feel free to reach out to our Customer Service team at (909)321-6683 or email us at customerservice@muuduufurniture.com at least 24 hours before your scheduled delivery.</li>\r\n 	<li style=\"text-align: center;\">If you want us to leave your merchandise outside of your location, please email in your order ID number, your driver license, and your instruction.</li>\r\n 	<li style=\"text-align: center;\">If your delivery time frame was confirmed and you can\'t receive your merchandise due to unplanned factors, we will assist you to reschedule your shipping and the original delivery fee will apply again.</li>\r\n</ul>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Delivery Information</h2>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\">$27.99 Flat shipping rate for most California cities between Sacramento to San Diego, exclude Victorville, Palmdale, Apple Valley, Hesperia, Lancaster, Indio and Big Bear Lake.</p>\r\n\r\n<h2 style=\"text-align: center;\">Other U.S. STATES, please email in the item number(s) you are interested, your city, your state, your contact information, and we will email you back with the shipping quote. Thank you for your business and support.</h2>\r\n</div>','Delivery','','inherit','closed','closed','','1155-revision-v1','','','2017-09-06 08:06:32','2017-09-06 08:06:32','',1155,'http://192.168.1.122/melrose/2017/09/06/1155-revision-v1/',0,'revision','',0),(1157,2,'2017-09-06 08:08:55','0000-00-00 00:00:00','<h2 style=\"text-align: center;\">Instructions</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n<ol>\r\n 	<li>Choose an item</li>\r\n 	<li>Click on to the picture to view details, change sizes, and available options</li>\r\n 	<li>Add to cart and click checkout to process the order</li>\r\n</ol>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Payment</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nWe accept cash, check, debit card, credit card, and PayPal.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Terms and Conditions</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n<ul>\r\n 	<li>Until received by Buyer, all risk of loss to the above-described goods is borne by Seller.</li>\r\n 	<li>The seller warrants that the goods are free from any and all security interests, liens, and encumbrances.</li>\r\n 	<li>Seller reserves the right not to accept or cancel your order in the case of an extreme pricing error or clerical error is subject to correction.</li>\r\n 	<li>Buyer has the right to examine the goods upon receipt and has 7 days in which to notify seller of any claim for damages based on the condition, grade, quality or quality of the goods<strong>via email only</strong>. Such notice must specify in detail the particulars of the claim. Failure to provide such notice within the requisite time period constitutes irrevocable acceptance of the goods. Please send your concerns to<strong>customerservice@muuduufurniture.com</strong>. Customer service department will attempt to respond within 24 hours upon receipt. Thank you for your patience.</li>\r\n 	<li>All damaged products will be replaced within 2-3 business days.</li>\r\n 	<li>Muuduu Furniture is not responsible for any property damages for in-home deliveries. For more info, please contact customer service department.</li>\r\n 	<li>Promotion and discount only apply to your next order. No exception. One person per order. Thank you for your business.</li>\r\n 	<li><b>Actual product color may vary from what is shown due to computer settings, room lighting, and personal perception. Please use as a reference only.</b></li>\r\n</ul>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Warranty</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nAll of our products have a three months limited warranty from the date of delivery. Please check your merchandise for manufacturers defects once it arrives at your location. The manufacturers warranty does not include damage from wrong assembly, unauthorized repair, negligence, misuse, etc.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Interior Design Service</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nMuuduu Furniture provides Exterior and Interior services that include Residential, Commercial, and Hospitality design. Our work reflects an enduring commitment to exceed client expectations while meeting all time and budget constraints. There is no budget too small for us. Please give us a call and you will be surprised how much affordable interior designing can be.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Assembly Service</h2>\r\n\r\n<hr />\r\n\r\n<ul>\r\n 	<li style=\"text-align: center;\">We offer professional assembly service for $29.99 for each product. Bunk beds that have staircases and our high-end beds will be charged for two assembly services. Please call in for more info.</li>\r\n 	<li style=\"text-align: center;\">You can book assembly services at Step 4:<strong>Delivery Method</strong>when you checkout. However, everything we sell comes in a brand new box and ready for setup (manual and required tools are included). Most of our products will take you from 15 to 50 minutes to assemble.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Terms Conditions','','draft','open','open','','','','','2017-09-06 08:08:55','2017-09-06 08:08:55','',0,'http://192.168.1.122/melrose/?p=1157',0,'post','',0),(1158,2,'2017-09-06 08:08:55','2017-09-06 08:08:55','<h2 style=\"text-align: center;\">Instructions</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n<ol>\r\n 	<li>Choose an item</li>\r\n 	<li>Click on to the picture to view details, change sizes, and available options</li>\r\n 	<li>Add to cart and click checkout to process the order</li>\r\n</ol>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Payment</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nWe accept cash, check, debit card, credit card, and PayPal.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Terms and Conditions</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n<ul>\r\n 	<li>Until received by Buyer, all risk of loss to the above-described goods is borne by Seller.</li>\r\n 	<li>The seller warrants that the goods are free from any and all security interests, liens, and encumbrances.</li>\r\n 	<li>Seller reserves the right not to accept or cancel your order in the case of an extreme pricing error or clerical error is subject to correction.</li>\r\n 	<li>Buyer has the right to examine the goods upon receipt and has 7 days in which to notify seller of any claim for damages based on the condition, grade, quality or quality of the goods<strong>via email only</strong>. Such notice must specify in detail the particulars of the claim. Failure to provide such notice within the requisite time period constitutes irrevocable acceptance of the goods. Please send your concerns to<strong>customerservice@muuduufurniture.com</strong>. Customer service department will attempt to respond within 24 hours upon receipt. Thank you for your patience.</li>\r\n 	<li>All damaged products will be replaced within 2-3 business days.</li>\r\n 	<li>Muuduu Furniture is not responsible for any property damages for in-home deliveries. For more info, please contact customer service department.</li>\r\n 	<li>Promotion and discount only apply to your next order. No exception. One person per order. Thank you for your business.</li>\r\n 	<li><b>Actual product color may vary from what is shown due to computer settings, room lighting, and personal perception. Please use as a reference only.</b></li>\r\n</ul>\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Warranty</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nAll of our products have a three months limited warranty from the date of delivery. Please check your merchandise for manufacturers defects once it arrives at your location. The manufacturers warranty does not include damage from wrong assembly, unauthorized repair, negligence, misuse, etc.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Interior Design Service</h2>\r\n\r\n<hr />\r\n\r\n<div style=\"text-align: center;\">\r\n\r\nMuuduu Furniture provides Exterior and Interior services that include Residential, Commercial, and Hospitality design. Our work reflects an enduring commitment to exceed client expectations while meeting all time and budget constraints. There is no budget too small for us. Please give us a call and you will be surprised how much affordable interior designing can be.\r\n\r\n</div>\r\n<div>\r\n<h2 style=\"text-align: center;\">Assembly Service</h2>\r\n\r\n<hr />\r\n\r\n<ul>\r\n 	<li style=\"text-align: center;\">We offer professional assembly service for $29.99 for each product. Bunk beds that have staircases and our high-end beds will be charged for two assembly services. Please call in for more info.</li>\r\n 	<li style=\"text-align: center;\">You can book assembly services at Step 4:<strong>Delivery Method</strong>when you checkout. However, everything we sell comes in a brand new box and ready for setup (manual and required tools are included). Most of our products will take you from 15 to 50 minutes to assemble.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Terms Conditions','','inherit','closed','closed','','1157-revision-v1','','','2017-09-06 08:08:55','2017-09-06 08:08:55','',1157,'http://192.168.1.122/melrose/2017/09/06/1157-revision-v1/',0,'revision','',0),(1159,2,'2017-09-06 08:10:19','0000-00-00 00:00:00','<ul>\r\n 	<li style=\"text-align: center;\">If you have changed your mind on an item, no problem. Just simply give us a call at 909-895-4141 or email in customerservice@muuduufurniture.com.</li>\r\n 	<li style=\"text-align: center;\">You may return and exchange new and unused products in their original packaging within the first 7 days since the date of purchase; a 25% restocking fee and a delivery fee will exclude from your original payment.</li>\r\n 	<li style=\"text-align: center;\">Item(s) already used and assembled or without original packaging does not qualify for the exchange and refund policy.</li>\r\n 	<li style=\"text-align: center;\">If your product is defective, you can only exchange it for the same product for free of charge within the first 7days since the date of receipt. Exchanging to a different product will be charged a 25% restocking fee.</li>\r\n 	<li style=\"text-align: center;\">Due to our fast delivery service, orders can only be canceled during the first 8 hours since the time of purchase. Cancellations after 8 hours will be charged a 25% cancellation fee.</li>\r\n 	<li style=\"text-align